define({"topics" : [{"title":"Time zone considerations","shortdesc":"\n                     <p class=\"shortdesc\">The report period is determined using the time zone where the system is installed,         not the time zone where you are\n                        running Reporter console or the time zone where the events         you are querying on occurred.\n                     </p>\n                  ","href":"time_zone_considerations.html","attributes": {"data-id":"time_zone_considerations",},"menu": {"hasChildren":false,},"tocID":"time_zone_considerations-d66e3193","topics":[]},{"title":"Activity Journal archive considerations","shortdesc":"\n                     <p class=\"shortdesc\">By default, the Activity Journal stores data for 90 days before archiving it, but         this setting can be changed by the\n                        database administrator.\n                     </p>\n                  ","href":"activity_journal_archive_considerations.html","attributes": {"data-id":"activity_journal_archive_considerations",},"menu": {"hasChildren":false,},"tocID":"activity_journal_archive_considerations-d66e3204","topics":[]}]});